import React from 'react'
import { registerWithEmailAndPassword } from '../config/functions';


function Authen() {
    const [uName, setUname] = React.useState('');
    const [uPw, setUpw] = React.useState('');

    const LoginHandle = () =>{
        registerWithEmailAndPassword(uName, uPw)
    }

  return (
    <div className='container-fluid'>
        <div className='login-form form m-auto w-full md:w-1/5'>
        <h3 className='text-3xl font-bold'>Welcome back</h3>
        <input className='w-full' name='email' placeholder='Email' value={uName} onChange={(e) => setUname(e.target.value)} />
        <input className='w-full' name='password' placeholder='Password' onChange={(e) => setUpw(e.target.value)} />
        <button className='btn' onClick={LoginHandle()}>Login</button>
        </div>

    </div>
  )
}

export default Authen
